import { useEffect, useState } from "react";

export const Products = (props) => { 

    const [infos, setInfos] = useState([]);

    useEffect(() => {
        const offset = (props.offset) * 5;
        setInfos(props.items.slice(offset));
        console.log(infos);
    }, [props.offset, props.items]);

    return(
        <div>
            {infos && infos.map((item) => (
                <div key={item.carClassId}>
                    <img src= {item.image} alt={`${item.carClassNfame} 차량`}/>
                    <p>{item.carClassName}</p>
                    <p>{item.carModel}</p>
                    <p>{item.carTypeTags}</p>
                    <p>{item.discountPercent}</p>
                    <p>{item.drivingDistance}</p>
                    <p>{item.price}</p>
                    <p>{item.regionGroups}</p>
                    <p>{item.year}</p>
                </div>    
            ))}

        </div>
    );
}

export default Products;
